    <Card  className={classes.card}>
     <ArticleHeader/>
     <Box>
     <Picture/>
     </Box>
      <CardContent>
        <Typography variant="body2" color="textSecondary" component="p">
          chand satr aval maghale inja neshun dade she
        </Typography>
      </CardContent>
      <Actions />
    </Card>
  );
}
